import TodoItem from "./TodoItem";
import styles from "./TodoList.module.css";

export default function TodoList({ todos, setTodos }) {
  return (
    <div>
      {todos.length > 0 ? (
        <div className={styles.listitem}>
          {todos.map((item) => (
            <TodoItem
              key={item}
              item={item}
              todos={todos}
              setTodos={setTodos}
            />
          ))}
        </div>
      ) : (
        <div></div>
      )}
    </div>
  );
}
